import { fromJS } from "immutable";
const defaultState = fromJS({
    topicList: [{
        id:1,
        title:"社会热点",
        imgUrl:"https://image.so.com/view?q=%E4%BD%95%E5%A4%AA%E5%90%8E%E7%9A%AE%E8%82%A4&src=srp&correct=%E4%BD%95%E5%A4%AA%E5%90%8E%E7%9A%AE%E8%82%A4&ancestor=list&cmsid=74e7208a9daa16bdd7b606e594ca84f3&cmras=0&cn=0&gn=0&kn=0&crn=0&bxn=0&fsn=60&cuben=0&pornn=0&manun=0&adstar=0&clw=270#id=dd91849329a68b4d3a20de341794ffee&currsn=0&ps=58&pc=58"
    },{
        id:2,
        title:"手绘",
        imgUrl:"https://ss2.bdstatic.com/70cFvnSh_Q1YnxGkpoWK1HF6hhy/it/u=1074417518,1198280004&fm=26&gp=0.jpg" 
    }
    ]    
});
// eslint-disable-next-line
export default (state = defaultState, action) => {
    switch(action.type) {
        default:
            return state;
    }
}
